import React, { Component } from 'react';
import {
 Collapse,
   Navbar,
   NavbarToggler,
   NavbarBrand,
   Nav,
   NavItem,
   NavLink,
   UncontrolledDropdown,
   DropdownToggle,
   DropdownMenu,
   DropdownItem} from 'reactstrap';
import { NavLink as RRNavLink} from "react-router-dom";
import { About } from "./About";

 export class NavigationBar extends Component{
  constructor(props){
    super(props)

    this.toggleNavbar = this.toggleNavbar.bind(this);
    this.state = {
      collapsed:true
    }
  }

   toggleNavbar() {
        this.setState({
          collapsed: !this.state.collapsed
        });
    }

    render(){
      return(
        <div id="nav-bar">
            <Navbar color="faded" dark staticTop="true">
              <NavbarBrand href="/">dQA</NavbarBrand>
              <span>
                <NavLink href='#visual-intro'>Home</NavLink>
                <NavLink href='#content-section'>Content</NavLink>
                <NavLink href='#about-section'>About</NavLink>
                <NavLink href='#contact-section'>Contact</NavLink>
              </span>
            </Navbar>
        </div>
      );
    }
 }
